import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import TopBar from './components/TopBar';
import SideBar from './components/SideBar';
import AppContainer from './components/AppContainer';

function App() {
  return (
    <div className="App">
      <TopBar />
      <SideBar />
      <AppContainer />
    </div>
  );
}

export default App;
